import React from 'react';
import './App.css';
import Container from 'react-bootstrap/Container'

import axios from 'axios';

var obj;
var response;
var symbol;
var open;
var elements;

export default class PersonList extends React.Component {
  state = {
    persons: []
  }

  componentDidMount() {
    axios.get(`https://polisen.se/api/events?DateTime=2021-01&type=Misshandel`)
      .then(res => {
        obj = res.data;
        response = obj[Object.keys(obj)[0]];
        symbol = JSON.stringify(response[Object.keys(response)[0]]);
        open = JSON.stringify(response[Object.keys(response)[1]]);
        elements = {symbol: symbol, open: open}
        const persons = elements;
        this.setState({ persons });
      })
  }

  render() {
    return (
      <Container>
<table>
  <tr>
    <th>{ this.state.persons.symbol}</th>
    <th>{ this.state.persons.open}</th>
  </tr>
</table>
</Container>
    )
  }
}
